import React, { useState } from "react";
import { Table, Modal, Button } from "react-bootstrap";

import Protocol from "./protocol";

const ProtocolsList = (props) => {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);

  const handleShow = () => setShow(true);

  const handleSubmit = async (event) => {
    event.preventDefault();
    console.log("Crea nuevo protocolo");
  };

  return (
    <>
      <div class="protocol-list">
        <Modal show={show} onHide={handleClose}>
          <Modal.Header closeButton>
            <Modal.Title>Agregar Protocolo</Modal.Title>
          </Modal.Header>
          <Modal.Body>
            <Protocol id={props.match.params.id} />
          </Modal.Body>
          <Modal.Footer>
            <Button variant="secondary" onClick={handleClose}>
              Cancelar
            </Button>
          </Modal.Footer>
        </Modal>
        <div class="header">
          <h3>Listado de protocolos del proyecto</h3>
          <Button variant="success" onClick={handleShow}>
            + Agregar Protocolo
          </Button>
        </div>
        <Table striped bordered hover size="sm">
          <thead>
            <tr>
              <th>Id</th>
              <th>Nombre</th>
              <th>Responsable</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Protocolo 1</td>
              <td>Camila</td>
            </tr>
          </tbody>
        </Table>
      </div>
      <Button variant="link">Volver a los proyectos</Button>
    </>
  );
};

export default ProtocolsList;
